import React from 'react';
import problems_list from "./problems"

class problem_page{
    constructor({match, location}) {
        const {params: {id}} = match;
        this.id = 1;
    }
    render() {


        return (
            <div>
                <h1>Я {problems_list[this.id]} задача {this.id}</h1>
            </div>
        )
    }
}

export default problem_page;
